import React from 'react';
import styles from './ServiceMain.module.css';
import Services from '../Services/Services';
import repair from '../../../Assets/Images/repair.png';
import phone from '../../../Assets/Images/phone.jpg';
import transfer from '../../../Assets/Images/money.png';
import cafe from '../../../Assets/Images/cafe.png';
import aos from 'aos';
import 'aos/dist/aos.css';



const serviceMain = () => {

    aos.init({});

    return(
    <div className={styles.ServiceMain}>
        <h2>What you are Looking For Today</h2>
        <div className={styles.Ext}>
            <Services data-aos-easing='fade-up' img={repair} title='Phone Repair'/>
            <Services data-aos='fade-up' img={cafe} title='Tablet Repair'/>
            <Services data-aos='fade-up' img={cafe} title='Laptop Repair'/>
            <Services data-aos='fade-up' img={cafe} title='Computer Repair'/>
            <Services data-aos='fade-up' img={cafe} title='Computer Assecories'/>
            <Services data-aos='fade-up' img={phone} title='Browse Phone'/>
            <Services data-aos='fade-up' img={transfer} title='Money Transfer'/>
            <Services data-aos='fade-up' img={cafe} title='Electronics'/>

        </div>
    </div>)
}

export default serviceMain;
